import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'





class NavBer extends Component {
    render() {
        return (
            <div>
               
               <>
  <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">COVIT-19 SURVEY FORM</Navbar.Brand>
    <Nav className="NavBer" style={{
        color:"green"
    }}>
      <Nav.Link href="#home">Home</Nav.Link>
      <Nav.Link href="#survey">Survey</Nav.Link>
      <Nav.Link href="#liveStats">COVIT-19 Live Stats</Nav.Link>
      <Nav.Link href="#about">About Us</Nav.Link>
      <Nav.Link href="#login">Login</Nav.Link>
      <Nav.Link href="#registration">Registration Now</Nav.Link>

      
    </Nav>
    
  </Navbar>
 

  </>
            </div>
        );
    }
}

export default NavBer;
